INSERT INTO table_photo VALUES("28","poduct-1-1758-7258.jpeg","COMPLEX is a community of creators and curators, armed with the Internet, committed to surfacing and sharing the voices and conversations that define our new America. Our videos exemplify convergence culture, exploring topics that include music, sneakers, style, sports and pop culture through original shows and Complex News segments. Featuring your favorite celebrities, authoritative commentary, and a unique voice, our videos make culture pop.","COMPLEX là một cộng đồng gồm những người sáng tạo và người quản lý, được trang bị Internet, cam kết xuất hiện và chia sẻ những tiếng nói và cuộc trò chuyện xác định nước Mỹ mới của chúng ta. Video của chúng tôi thể hiện văn hóa hội tụ, khám phá các chủ đề bao gồm âm nhạc, giày thể thao, phong cách, thể thao và văn hóa đại chúng thông qua các chương trình gốc và phân đoạn Tin tức phức hợp. Với những người nổi tiếng yêu thích của bạn, bình luận có thẩm quyền và giọng nói độc đáo, video của chúng tôi làm nổi bật văn hóa.","Billie Eilish goes Sneaker Shopping at Stadium Goods in New York City and talks about how Riff Raff\'s music got her into Jordans, potentially working with Jordan Brand on a shoe, and why she likes men\'s sneakers.","Billie Eilish đi mua sắm giày thể thao tại Stadium Goods ở thành phố New York và nói về cách âm nhạc của Riff Raff đã đưa cô ấy đến với Jordans, có khả năng hợp tác với Jordan Brand về một đôi giày và tại sao cô ấy thích giày thể thao nam.","Billie Eilish Goes Sneaker Shopping With Complex","Billie Eilish đi mua sắm giày thể thao với khu phức hợp","","https://www.youtube.com/watch?v=EvdzQdnZPcw","","video","photo_static","0","hienthi","1609288413","1621819276");
